import "./App.css";

import UserList from "./component/UserList";
import UserData from "./component/UserData";
import avtar4 from "./images/avtar4.jpg";
import { useState } from "react";
// console.log(UserData[0].name);
function App() {
  const [inHover, setHover] = useState(false);


  return (
    <div className="main">

      <table >
        <tr>
          <th className="settitle1">Name</th>
          <th className="settitle2">Status</th>
          <th className="settitle3"> Access</th>
        </tr>
      </table>
      <div className="main2" onMouseEnter={() => setHover(true)}
            onMouseLeave={() => setHover(false)}>
               {inHover && <p className="hover">  <div class="card">
  <img src={avtar4} alt="Avatar" className="imgset"/>
  <div class="container">
    <h4><b>John Doe</b></h4> 
    <p>Architect & Engineer</p> 
  </div>
</div></p>}
      {UserData.map((user,index) => {
          return(

            <UserList
            key = {index}
            imgavtar={user.imgavtar}
            name={user.name}
            email={user.email}
            status={user.status}
            Access={user.Access}
            action={user.action}
          />

          )
      })}
      </div>
    </div>
  );
}

export default App;
